import * as ReactDOM from "react-dom";
import App from "./components/App/App";
import ErrorBoundary from "./components/ErrorBoundary/ErrorBoundary";
import {BookStoreServiceProvider} from "./components/BookStoreServiceCondext/BookStoreServiceCondext";
import {Provider} from "react-redux";
import {BrowserRouter} from "react-router-dom";
import bookStoreService from "./services/bookStoreService";
import {store} from "./store";

const BookStoreService = new bookStoreService()

ReactDOM.render
(
    <Provider store={store}><ErrorBoundary><BookStoreServiceProvider value={BookStoreService}><App/></BookStoreServiceProvider></ErrorBoundary></Provider>,
    document.querySelector('#root')
)
